import{_ as e,c as t,o as r,d as a}from"./app.a14d7938.js";const u=JSON.parse('{"title":"\uC18C\uAC1C","description":"","frontmatter":{},"headers":[{"level":2,"title":"\uC65C REBS\uB97C \uC0AC\uC6A9\uD558\uB098\uC694?","slug":"\uC65C-rebs\uB97C-\uC0AC\uC6A9\uD558\uB098\uC694"},{"level":2,"title":"\uC8FC\uC694 \uAE30\uB2A5","slug":"\uC8FC\uC694-\uAE30\uB2A5"},{"level":2,"title":"\uC65C REBS\uC778\uAC00?","slug":"\uC65C-rebs\uC778\uAC00"}],"relativePath":"index.md","lastUpdated":1660142009000}'),i={name:"index.md"},l=a('<h1 id="\uC18C\uAC1C" tabindex="-1">\uC18C\uAC1C <a class="header-anchor" href="#\uC18C\uAC1C" aria-hidden="true">#</a></h1><p><strong>REBS</strong>\uB294 \uAC04\uB2E8\uD55C \uC785\uCD9C\uAE08, \uBB38\uC11C \uAD00\uB9AC\uB97C \uD3EC\uD568\uD55C \uBD80\uB3D9\uC0B0 \uAC1C\uBC1C(\uC2DC\uD589) \uAD00\uB9AC\uD504\uB85C\uADF8\uB7A8\uC785\uB2C8\uB2E4.</p><h2 id="\uC65C-rebs\uB97C-\uC0AC\uC6A9\uD558\uB098\uC694" tabindex="-1">\uC65C REBS\uB97C \uC0AC\uC6A9\uD558\uB098\uC694? <a class="header-anchor" href="#\uC65C-rebs\uB97C-\uC0AC\uC6A9\uD558\uB098\uC694" aria-hidden="true">#</a></h2><p>\uBD80\uB3D9\uC0B0 \uAC1C\uBC1C(\uC2DC\uD589) \uD504\uB85C\uC81D\uD2B8\uB97C \uC9C4\uD589\uD560 \uB54C\uC5D0 \uACF5\uB3D9\uC8FC\uD0DD, \uC8FC\uC0C1\uBCF5\uD569, \uC624\uD53C\uC2A4\uD154, \uC0C1\uAC00, \uC219\uBC15\uC2DC\uC124 \uB4F1 \uC5EC\uB7EC \uC720\uD615\uC758 \uC0C1\uD488\uB4E4\uC744 \uAC1C\uBC1C\uD558\uAE30 \uC704\uD574\uC11C \uC138\uBD84\uD654 \uB41C \uB2E4\uC591\uD55C \uD0C0\uC785 \uBC0F \uC0C1\uD488 \uC635\uC158\uC5D0 \uB530\uB978 \uC5EC\uB7EC \uC0C1\uD488\uC758 \uD615\uD0DC\uC640 \uB2E4\uC591\uD55C \uACC4\uC57D \uC870\uAC74 \uC635\uC158 \uB4F1\uC744 \uBAA8\uB450 \uBC18\uC601\uD558\uC5EC \uAD00\uB9AC\uD558\uAE30\uB780 \uC27D\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.</p><p>\uB610\uD55C \uC774\uCC98\uB7FC \uBCF5\uC7A1\uD55C \uC0C1\uD488 \uC720\uD615\uC744 \uC77C\uBC18\uBD84\uC591, \uC870\uD569\uC6D0 \uBAA8\uC9D1 \uBC29\uC2DD \uB4F1 \uB2E4\uC591\uD55C \uD615\uD0DC\uC758 \uC0AC\uC5C5 \uBC29\uBC95\uC73C\uB85C \uC2DC\uD589\uC744 \uC9C4\uD589 \uD558\uAC8C \uB420 \uACBD\uC6B0 \uB3D9\uC77C\uD55C \uB370\uC774\uD130\uB77C\uB3C4 \uAD00\uB9AC\uD558\uB294 \uD504\uB85C\uC138\uC2A4\uAC00 \uD544\uC5F0\uC801\uC73C\uB85C \uB2EC\uB77C\uC9C8 \uC218\uBC16\uC5D0 \uC5C6\uC5B4\uC11C, \uC774\uB7F0 \uD504\uB85C\uC138\uC2A4\uB85C \uC0DD\uC0B0\uB418\uB294 \uB370\uC774\uD130\uB97C \uD6A8\uACFC\uC801\uC73C\uB85C \uAD00\uB9AC\uD558\uB294 \uAC83\uC740 \uB354\uC6B1 \uBCF5\uC7A1\uD558\uACE0 \uC5B4\uB835\uC2B5\uB2C8\uB2E4.</p><p>\uD55C\uD3B8, \uBD80\uB3D9\uC0B0 \uAC1C\uBC1C\uC0AC\uC5C5\uC740 \uC774\uB807\uAC8C \uC911\uC694\uD55C \uB370\uC774\uD130\uB4E4\uC744 \uAD00\uB9AC\uD558\uAE30\uC5D0 \uC55E\uC11C, \uC774\uBBF8 \uACE0\uB3C4\uC758 \uC804\uBB38\uC131\uC744 \uC694\uD558\uB294 \uC0C1\uD488 \uB514\uC790\uC778, \uC0AC\uC5C5 \uC218\uD589 \uAE30\uAC04\uC744 \uBC18\uC601\uD55C \uC2DC\uC7A5 \uC218\uC694\uC5D0 \uB300\uD55C \uC608\uCE21 \uBC0F \uD0C0\uC774\uBC0D, \uC778\uD5C8\uAC00\uC640 \uAD00\uB828\uD55C \uAC01\uC885 \uBC95\uB960\uC801\uC778 \uC0AC\uD56D, \uD1A0\uC9C0 \uB9E4\uC785, \uB300\uADDC\uBAA8 \uC790\uAE08 \uC870\uB2EC \uB4F1 \uAE30\uD68D \uB2E8\uACC4\uC5D0\uC11C\uBD80\uD130 \uACE0\uB824\uD560 \uC0AC\uC5C5\uC758 \uC131\uD328\uB97C \uC88C\uC6B0\uD560 \uB9CC\uD07C \uC911\uC694\uD55C \uC0AC\uC548\uB4E4\uC774 \uB9CE\uC2B5\uB2C8\uB2E4.</p><p><strong>REBS</strong>\uB294 \uAC1C\uBC1C\uC0AC\uC5C5\uC744 \uC2DC\uD589\uD558\uB294 \uC6B4\uC601\uC790\uAC00 \uC774 \uAC19\uC774 \uB354 \uC911\uC694\uD55C \uC0AC\uC548\uC5D0 \uC9D1\uC911\uD560 \uC218 \uC788\uB3C4\uB85D, \uD504\uB85C\uC81D\uD2B8\uB97C \uC218\uD589\uD558\uBA74\uC11C \uC0DD\uC0B0\uB418\uB294 \uB370\uC774\uD130\uB97C <strong>\uC815\uD655\uD558\uACE0 \uD3B8\uB9AC\uD558\uAC8C \uAD00\uB9AC\uD558\uACE0 \uC27D\uAC8C \uC5F4\uB78C</strong>\uD560 \uC218 \uC788\uB3C4\uB85D \uC124\uACC4\uB418\uC5C8\uC2B5\uB2C8\uB2E4. \uB610\uD55C \uC774\uB7F0 \uBAA9\uC801\uC744 \uAD6C\uD604\uD558\uAE30 \uC704\uD574\uC11C \uC9C0\uC18D\uC801\uC73C\uB85C \uADF8 \uAE30\uB2A5\uC744 \uAC1C\uC120\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="\uC8FC\uC694-\uAE30\uB2A5" tabindex="-1">\uC8FC\uC694 \uAE30\uB2A5 <a class="header-anchor" href="#\uC8FC\uC694-\uAE30\uB2A5" aria-hidden="true">#</a></h2><ul><li>\uD504\uB85C\uC81D\uD2B8 \uC885\uB958 \uBC0F \uD2B9\uC9D5\uC5D0 \uB530\uB978 \uC0C1\uC138 \uC124\uC815 \uC9C0\uC6D0 <ul><li>\uACC4\uC57D \uADF8\uB8F9, \uC720\uB2DB \uD0C0\uC785, \uCE35\uBCC4 \uD0C0\uC785, \uB3D9/\uD638 \uB4F1\uB85D \uAD00\uB9AC</li><li>\uACC4\uC57D \uBC29\uBC95(\uACC4\uC57D \uAE08\uC561) \uBC0F \uC804\uCCB4 \uB0A9\uBD80 \uD68C\uCC28 \uB4F1\uB85D \uAD00\uB9AC</li><li>\uADF8\uB8F9\uBCC4, \uD0C0\uC785\uBCC4, \uCE35\uBCC4 \uACF5\uAE09 \uB300\uAE08(\uBD84\uC591\uAC00) \uB4F1\uB85D \uAD00\uB9AC</li><li>\uC0AC\uC5C5 \uBD80\uC9C0, \uC18C\uC720\uC790 \uBAA9\uB85D \uBC0F \uB9E4\uC785 \uACC4\uC57D \uCCB4\uACB0 \uAD00\uB9AC</li></ul></li><li>\uACC4\uC57D \uBC0F \uACC4\uC57D \uACE0\uAC1D \uB4F1\uB85D \uAD00\uB9AC, \uB2E4\uC591\uD55C \uD604\uD669 \uC9D1\uACC4</li><li>\uD310\uB9E4 \uC0C1\uD488 \uC720\uB2DB\uACFC \uACC4\uC57D \uACE0\uAC1D\uC758 1:1 \uB9E4\uCE6D \uB4F1\uB85D \uAD00\uB9AC</li><li>\uC77C\uBC18 \uC785\uCD9C\uAE08 \uD68C\uACC4 \uAD00\uB9AC \uBC0F \uACE0\uAC1D \uB300\uAE08 \uC218\uB0A9\uACFC \uC5F0\uB3D9 \uAD00\uB9AC</li><li>\uACE0\uAC1D \uB0A9\uBD80 \uB300\uAE08 \uC218\uB0A9 \uAD00\uB9AC \uBC0F \uC0AC\uC5C5 \uC608\uC0B0\uACFC \uC5F0\uB3D9 \uAD00\uB9AC</li><li>\uC0AC\uC5C5 \uC608\uC0B0 \uAD00\uB9AC \uBC0F PJ \uC9C4\uD589 \uC0C1\uD669\uC5D0 \uB530\uB978 \uC608\uC0B0 \uB300\uBE44 \uC9D1\uACC4</li><li>\uBCF8\uC0AC \uBC0F \uD504\uB85C\uC81D\uD2B8 \uBB38\uC11C \uAD00\uB9AC \uBC0F \uC18C\uC1A1 \uC0AC\uAC74 \uAD00\uB9AC</li></ul><p>\uC804\uCCB4 \uAE30\uB2A5\uC740 <a href="./.html">\uC2DC\uC791\uD558\uAE30</a> \uBC0F \uAC01\uAC01\uC758 \uCC55\uD130\uB97C \uC9C1\uC811 \uBC29\uBB38\uD558\uC5EC \uCC38\uACE0\uD558\uC138\uC694.</p><h2 id="\uC65C-rebs\uC778\uAC00" tabindex="-1">\uC65C REBS\uC778\uAC00? <a class="header-anchor" href="#\uC65C-rebs\uC778\uAC00" aria-hidden="true">#</a></h2><p>REBS\uB294 <strong>R</strong>eal<strong>E</strong>state <strong>B</strong>uild <strong>S</strong>ystem :: smart developer \uC758 \uC57D\uC5B4\uC785\uB2C8\uB2E4. \uBD80\uB3D9\uC0B0 \uAC1C\uBC1C \uC0AC\uC5C5\uC740 \uC0AC\uB78C\uC774 \uC0B4\uC544\uAC00\uB294 \uACF5\uAC04\uC744 \uB514\uC790\uC778\uD558\uACE0 \uCC3D\uC870\uD558\uB294 \uC791\uC5C5\uC785\uB2C8\uB2E4.</p>',12),s=[l];function n(d,o,h,p,_,c){return r(),t("div",null,s)}var S=e(i,[["render",n]]);export{u as __pageData,S as default};
